import React from 'react';
import logo from './logo.svg';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import MainPage from './Pages/MainPage';

export default function WebPages() {
  return (
      <BrowserRouter>
      <Switch>
          <Route exact path="/">
            <MainPage />
          </Route>
          <Route exact path="/">
            <MainPage />
          </Route>
      </Switch>
      </BrowserRouter>

  );
}
